import React, { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import { toast } from "react-toastify";
import { createUrl, log } from "../../utils/utils";
import { getDoctorById } from "../../services/user";
import { Link } from 'react-router-dom';
import { useEffect } from "react";
import "../../styles/car-item.css";
//import DoctorItem from "../UI/DoctorItem";

const ServiceBook1 = () => {
  const { id, name } = useParams();
  // const [description, setDescription] = useState("");
  // const [carId, setCarId] = useState("");
  const [doctor, setDoctor] = useState([]);
  const navigate = useNavigate();

  const services = [
    { id: 1, option: 'Edit Profile' }
  ];

  const schedule =

    useEffect(() => {
      getDoctor();
    }, [])
  const getDoctor = async () => {
    try {
      debugger;
      const doctorId = sessionStorage.getItem("userId");
      console.log(doctorId);
      const response = await getDoctorById(doctorId);
      debugger;
      console.log(response);
      setDoctor(response);
      debugger;
    } catch (error) {
      console.error(error);
      toast.error("An error occurred during getching doctor");
    }
  };

  const Back = () => {
    navigate('/DoctorServices');
  }

  return (
    <div class="container">
      <div class="row">
        <div class="col"></div>
        <div class="col">
          <div class="form">
            <h1>Your Profile</h1>
            <div class="mb-3">
              <div class="table-responsive">
                <table class="table">
                  <tbody>
                    <tr>
                      <td colSpan="1"> Name:</td>
                      <td>{doctor.name} </td>
                    </tr>
                    <tr>
                      <td>Email: </td>
                      <td>{doctor.email}</td>
                    </tr>
                    <tr>
                      <td>Password:</td>
                      <td>{doctor.password} </td>
                    </tr>
                    <tr>
                      <td>Contact No: </td>
                      <td>{doctor.contactNo}</td>
                    </tr>
                    <tr>
                      <td>Specialisation: </td>
                      <td>{doctor.specialisation}</td>
                    </tr>
                    
                    <tr>
                      <td>Schedule:</td>
                      <td>
                        <ul>
                          {doctor.schedule && doctor.schedule.map((doc, index) => (
                            <li key={index}>{doc.day}</li>
                          ))}
                        </ul>
                      </td>
                    </tr>
                    {/* <tr>
                      <td>Schedule</td>
                      <td>
                        <ul>
                          {doctor.schedule.map((schedules, index) => (
                              <li key={index}>{schedules.day}</li>
                            ))}
                        </ul>
                      </td>
                    </tr> */}
                    {/* <tr>
                      <td>BloodGroup: </td>
                      <td>{patient.pbloodGroup}</td>
                    </tr> */}

                    <tr></tr>
                  </tbody>
                </table>
              </div>
            </div>

            {/* <button type="submit" class="btn btn-success" onClick={getPatient}>
              Submit
            </button> */}
          </div>
          <ul className='services-list'>
            {services.map((service) => (
              <li key={service.id} className='service-box'>
                <div className="service-content">
                </div>
                <Link

                  to={{
                    pathname: `/doctorEdit/${sessionStorage.getItem("userId")}`,
                    state: { serviceData: service }
                  }}
                  className="btn btn-primary"
                >
                  {service.option}
                </Link>
              </li>
            ))}
          </ul>
        </div>
        <div class="col"></div>
        <div >
          <button className='btn btn-primary'
            onClick={Back}>
            Back
           </button>
        </div>
      </div>
    </div>
  );
};

export default ServiceBook1;

